 */
contract NFLottie is Ownable, ERC721 {

    uint256 public NFLPrice = 50000000000000000; //0.05 ETH

    uint256 public constant maxNFLPurchase = 10;

    bool public saleIsActive = false;

    uint256 public MAX_NFL;

    constructor(string memory name, string memory symbol, uint256 maxNftSupply) ERC721(name, symbol) {
        MAX_NFL = maxNftSupply;
    }

    function withdraw(uint256 amount) public onlyOwner {
        payable(msg.sender).transfer(amount);
    }

    function updateMintPrice(uint256 newPrice) public onlyOwner {
        NFLPrice = newPrice;
    }

    /**
     * Set some NFL aside
     */
    function reserveNFL() public onlyOwner {        
        uint256 supply = totalSupply();
        uint256 i;
        for (i = 1; i < 10; i++) {
            _safeMint(msg.sender, supply + i);
        }
    }

    function setBaseURI(string memory baseURI) public onlyOwner {
        _setBaseURI(baseURI);
    }

    /*
    * Pause sale if active, make active if paused
    */
    function flipState() public onlyOwner {
        saleIsActive = !saleIsActive;
    }

    /**
    * Mints NFL
    */
    function mintNFL(uint8 numberOfTokens) public payable {
        uint256 supply = totalSupply();
        require(numberOfTokens <= maxNFLPurchase, "E11");
        require((supply + numberOfTokens) <= MAX_NFL, "E12");
        require(saleIsActive, "E10");
        require(NFLPrice * numberOfTokens <= msg.value, "E15");

        for(uint256 i = 1; i <= numberOfTokens; i++) {
            if (supply < MAX_NFL) {
                _safeMint(msg.sender, supply + i);
            }
        }
    }



}

